import React from "react";
import "./App.scss";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { LandingPage } from "./components/landing-page/landing-page-index";
import { StartPage } from "./components/landing-page/start-page";

class App extends React.Component {
  render() {
    return (
      <Router>
        <div className="App">
          <LandingPage></LandingPage>
          <Route path="/register" component={LandingPage}></Route>
          <Route path="/login" component={LandingPage}></Route>
        </div>
      </Router>
    );
  }
}

export default App;
